import React from "react";
import Navbar from "../components/Navbar/Navbar"
import HomePageHeader from "../components/Homepage/HomePageHeader";
import '../stylesheet/Home.css';

function Home() {
  return (
    <div>
        <Navbar />
        <HomePageHeader />
    </div>
  );
}

export default Home;
